using System;\nusing System.Text.RegularExpressions;\n\nclass Program {\n    static void Main() {\n        string pattern = @"^(?=.*[A-Za-z])[a-zA-Z0-9@\-_\+\.]{6,32}$";\n        \n        string[] testStrings = { "2rocks", "rocks2" };\n        \n        foreach (var str in testStrings) {\n            bool isMatch = Regex.IsMatch(str, pattern);\n            Console.WriteLine($"String '{str}' matches: {isMatch}");\n        }\n    }\n}